import React from 'react';

export default function MainStudySpace() {
  return (
    <div className="studySpaceContainer">
        <img src="../public/images/UBC_Irving_5-scaled.jpg"/>
        <h4>{props.name}</h4>
        <p>{props.desc}</p>
        <button>Go</button>
      <p>{props.desc}</p>
    </div>
  );
}
